export default function Top10() {
  const lineChartRef = useRef<HTMLCanvasElement | null>(null);
  const scatterChartRef = useRef<HTMLCanvasElement | null>(null);
  const bevPhevChartRef = useRef<HTMLCanvasElement | null>(null);

  const createLineChart = () => {
    const ctx = lineChartRef.current?.getContext('2d');
    if (ctx) {
      const months = ['JAN', 'FEB', 'MAR', 'APR', 'MAY', 'JUN'];
      const datasets = vehicleData.map(vehicle => ({
        label: `${vehicle.MAKE} ${vehicle.model}`,
        data: months.map(month => vehicle[month as keyof VehicleData]),
        borderColor: getRandomColor(),
        fill: false,
      }));

      new Chart(ctx, {
        type: 'line',
        data: {
          labels: months,
          datasets,
        },
      });
    }
  };

  const createScatterChart = () => {
    const ctx = scatterChartRef.current?.getContext('2d');
    if (ctx) {
      const priceData = vehicleData.map(vehicle => parseFloat(vehicle.Price.replace('$', '').replace(',', '')));
      const rangeData = vehicleData.map(vehicle => vehicle["All electric range (WLTP) (KM)"]);

      new Chart(ctx, {
        type: 'scatter',
        data: {
          datasets: [
            {
              label: 'Price vs Range',
              data: priceData.map((price, index) => ({ x: price, y: rangeData[index] })),
              borderColor: 'rgba(75, 192, 192, 1)',
              borderWidth: 1,
              pointRadius: 5,
              pointBackgroundColor: 'rgba(75, 192, 192, 1)',
              fill: false,
            },
          ],
        },
        options: {
          scales: {
            x: {
              type: 'linear',
              position: 'bottom',
              title: {
                display: true,
                text: 'Price ($)',
              },
            },
            y: {
              title: {
                display: true,
                text: 'All electric range (WLTP) (KM)',
              },
            },
          },
        },
      });
    }
  };

  const createBevPhevChart = () => {
    const ctx = bevPhevChartRef.current?.getContext('2d');
    if (ctx) {
      const bevPrices = vehicleData
        .filter(vehicle => vehicle.Type === 'BEV')
        .map(vehicle => parseFloat(vehicle.Price.replace('$', '').replace(',', '')));

      const phevPrices = vehicleData
        .filter(vehicle => vehicle.Type === 'PHEV')
        .map(vehicle => parseFloat(vehicle.Price.replace('$', '').replace(',', '')));

      new Chart(ctx, {
        type: 'bar',
        data: {
          labels: ['BEV', 'PHEV'],
          datasets: [
            {
              label: 'BEV vs PHEV Pricing',
              data: [bevPrices.reduce((a, b) => a + b, 0) / bevPrices.length, phevPrices.reduce((a, b) => a + b, 0) / phevPrices.length],
              backgroundColor: ['rgba(75, 192, 192, 0.5)', 'rgba(255, 99, 132, 0.5)'],
              borderWidth: 1,
            },
          ],
        },
        options: {
          scales: {
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: 'Average Price ($)',
              },
            },
          },
        },
      });
    }
  };

  const getRandomColor = () => {
    return `rgb(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255})`;
  };

  useEffect(() => {
    createLineChart();
    createScatterChart();
    createBevPhevChart();
  }, []);


  return (
    <motion.div
    initial={{ x: -200, opacity: 0 }}
    whileInView={{ x: 0, opacity: 1 }}
    viewport={{ once: true }}
    transition={{ duration: 1.2 }}
    className='h-screen flex relative overflow-hidden flex-col text-lft md:flex-row max-w-full px-10 justify-evenly mx-auto items-center'>


      <h3 className='absolute top-24 uppercase tracking-[20px] text-gray-500 text-2xl'>
        EV Registration Data 2022
      </h3>

      <div className='px-2 w-[50%] flex space-x-5 overflow-x-auto p-10 snap-x snap-mandatory items-center scrollbar scrollbar-track-slate-900/20 scrollbar-thumb-sky-300/30'>
        {vehicleData.map((vehicle, index) => (
          <article
            key={index}
            className='flex flex-col rounded-lg items-center space-y-7 flex-shrink-0 space-evenly w-[400px] h-fit md:w-[500px] xl:w-[600px] snap-center bg-slate-700 p-10 hover:opacity-100 opacity-90 cursor-pointer transition-opacity duration-200 overflow-hidden'
          >
            <div className='w-20 h-20 rounded-full xl:w-[200px] xl:h-[200px] overflow-hidden'>
            </div>

            <div className='px-0 md:px-10'>
              <h4 className='text-4xl font-light'>
                {vehicle.MAKE} {vehicle.model}
              </h4>
              <p className='text-gray-500'>{vehicle.variant}</p>
              <p>Type: {vehicle.Type}</p>
              <p>Price: {vehicle.Price}</p>
              <p>Useable battery capacity: {vehicle["Useable battery capacity in kWh"]} kWh</p>
              <p>All electric range (WLTP): {vehicle["All electric range (WLTP) (KM)"]} KM</p>
              <p>0-100 kph: {vehicle["0-100kph"]}</p>
            </div>
          </article>
        ))}
      </div>

      <div className='w-full h-[65%] bg-white flex space-x-5 overflow-x-auto snap-x snap-mandatory items-center scrollbar scrollbar-track-slate-900/20 scrollbar-thumb-sky-300/30'>
      <canvas
        ref={lineChartRef}
        className='mt-4'
      ></canvas>

      <canvas
        ref={scatterChartRef}
        className='mt-4'
      ></canvas>

      <canvas
        ref={bevPhevChartRef}
        className='mt-4'
      ></canvas>  
      </div>

    </motion.div>
  );
}
